// src/pages/WomenMinistry.js
import React from 'react';

const WomenMinistry = () => {
  return (
    <div>
      <h1>Women Ministry</h1>
      <p>Welcome to the Women Ministry.</p>
      <p>Provides pastoral care and counseling, addressing issues like marriage, child upbringing, and career challenges
      .</p>
    </div>
  );
};

export default WomenMinistry;
